function computeArray(s) {
  let alphabetSet = new Set(s);
  let result = [];
  for (let i = 0; i <= s.length; i++) {
    result.push({});
    for (let a of alphabetSet) {
      let k = min(s.length + 1, i + 2);
      do {
        k = k - 1;
      } while (!isEndMatch(s.substring(0, k), `${s.substring(0, i)}${a}`))

      if (k != 0)
        result[i][a] = k;
    }
    result[i]['default'] = 0;
  }
  return result;
}

function min(a, b) {
  return a > b ? b : a;
}

function isEndMatch(end, all) {
  if (end.length > all.length) {
    return false;
  }
  if (end.length == 0) return true;
  let endI = end.length - 1;
  let allI = all.length - 1;
  while (all[allI] == end[endI] && endI >= 0) {
    endI--;
    allI--;
  }
  return endI == -1;
}

var strStr = function(haystack, needle) {
  if (needle == '') return 0;
  if (needle.length > haystack.length) return -1;
  if (needle.length == haystack.length) {
    let i = needle.length - 1;
    do {
      if (haystack[i] !== needle[i])
        return -1;
      i--;
    } while (i >= 0);
    return 0;
  }
  let array = computeArray(needle);
  let finalState = array.length - 1;
  let exState = 0;
  for (let i = 0; i < haystack.length; i++) {
    exState = array[exState][haystack[i]] || array[exState]['default'];

    if (exState == finalState) return i - finalState + 1;
  }
  return -1;
};
